script: |
  super -f text -I q12025.spq | sort > q12025.out

inputs:
  - name: q12025.spq
    data: |
      SELECT + + col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NOT - col0 * + + 99 * - col2 >= 57 );
  - name: tab2

outputs:
  - name: q12025.out
    data: |
      46
      64
      75
